import React from "react";
import { Link } from "react-router-dom";
class Navbar extends React.Component {
  constructor() {
    super();
    this.state = {
      open: false,
    };
    this.handleOpen = this.handleOpen.bind(this);
    this.handleClose = this.handleClose.bind(this);
  }
  handleOpen() {
    this.setState({
      open: true,
    });
  }
  handleClose() {
    this.setState({
      open: false,
    });
  }
  render() {
    return (
      <section className="navbar">
        <div className="nav-left">StartUp</div>
        {!this.state.open && (
          <nav className="nav-center">
            <Link to="/">Home</Link>
            <Link to="/">About</Link>
            <Link to="/account">Contact</Link>
          </nav>
        )}
        <div className="nav-right">
          <button>Login</button>
          {!this.state.open && <button onClick={this.handleOpen}>Open</button>}
        </div>

        {this.state.open && (
          <div className="toggle-nav">
            <button className="cancel-button" onClick={this.handleClose}>
              X
            </button>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/">About</Link>
              </li>
              <li>
                <Link to="/">Contact</Link>
              </li>
            </ul>
          </div>
        )}
      </section>
    );
  }
}
export default Navbar;
